import React,{useState} from 'react';
import classes from './OneFile.module.css';
import { Document, Page,pdfjs,StyleSheet } from 'react-pdf';



const styles = StyleSheet.create({
  page: { backgroundColor: 'tomato' },
  section: { color: 'white', textAlign: 'center', margin: 30 }
});





const OneFile=()=>{

const url = "https://arxiv.org/pdf/1602.06581.pdf";


      const [numPages, setNumPages] = useState(null);
      const [pageNumber, setPageNumber] = useState(1);

    function onDocumentLoadSuccess({ numPages }) {
    setNumPages(numPages);
    setPageNumber(1);
  }





return (

<div className={classes.oneFile}>

     <Document
        file={url}
        onLoadSuccess={onDocumentLoadSuccess}
        width="100px"
	height="150px"
	>
        <Page pageNumber={pageNumber} style={styles.page} />

     </Document>






</div>

);



}

export default OneFile;
